import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [nayoks, setNayoks] = useState([])
  // const nayoks = [{name :'Jashim', age: 45},{name :'Deepjol', age : 50},{name: 'Manna', age: 60},{name :'Rubel', age : 55}]

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(res => res.json())
    .then(data => setNayoks(data))
  },[])

  return (
    <div className="App">
      {/* <MovieCounter></MovieCounter> */}
      <div className="herowrap">
      {
        nayoks.map(hero => <Nayok 
          key = {hero.id}
          name = {hero.name} 
          username = {hero.username}
          email = {hero.email}
          address = {hero.address.city}
          phone = {hero.phone}
          website = {hero.website}
        ></Nayok>)
      }
      </div>
    </div>
  );
}

function Nayok(props) {
  const {name, username, email, address, phone, website} = props
  return <>
    <section>
      <div className="wrap">
      <div className = "nayokbal" >
        <h1>I am : {name}</h1>
        <h4>My user name is : {username} </h4>
        <p>My email is: {email} </p>
        <p><b>Address: {address} </b></p>
        <p>Phone: {phone} </p>
        <p>Website: {website} </p>
      </div>
      </div>
    </section>
  </>
}

